BEGIN;

CREATE OR REPLACE FUNCTION C_FLIGHT() RETURNS VOID AS $$
DECLARE

  -- システム日付+120日間のフライト情報を登録
  currentDate DATE := current_date;
  endDate DATE := current_date+120;

  -- 登録期間を明示的に指定する場合
  -- currentDate DATE := '2013-12-1';
  -- endDate DATE := '2014-4-1';

  i INT;

BEGIN
  i := 0;
  WHILE currentDate <= endDate LOOP


    currentDate := currentDate + 1;
    i := i + 1;

    END LOOP;
END;
$$ LANGUAGE plpgsql;

SELECT C_FLIGHT();

DROP FUNCTION C_FLIGHT();

COMMIT;
